	('4601738004610EAN_13', 'Молочний шоколад мілка "З альпійським молоком"', '', 0, 5.7, 31, 57.5, 530, 'Цукор, масло какао, какао терте, молоко сухе цільне, молоко сухе обезжиренне, сироватка суха молочна, жир молочний, паста горіхова (фундук), емульгатори (лійцетин соєвий, Е476), ароматизатор "ванілін" МІСТИТЬ ФУНДУК, МОЛОЧНІ ПРОДУКТИ, ЛЕЦТИТИН СОЄВИЙ, МОЖЕ МІСТИТИ СЛІДИ АРАХІСУ, ІНШИХ ГОРІХІВ ТА ПШЕНИЦІ.'),
	('4607051313682EAN_13', 'Салат "Матье"', '', 0, 0.9, 11.8, 0.7, 112, 'Морські водорості, маринад, олія соняшникова, морква маринована, "спаржа" соєва маринована, паприка, суміш приправ, часник, сіль варена харчова, підсолоджувач Е954, оцет, консервант Е211. '),
	('4820001520415EAN_13', 'Смачна хвилинка "7 злаків"', '', 0, 9.5, 1.7, 70.3, 335, 'Крупи: кукурудзяна, рисова, пшенична, гречана, ячна, пшоно, пластівці вівсяні.'),
	('7622300652753EAN_13', 'Крекери Tuc "Паприка"', '', 0, 21, 22, 545, 545, 'Борошно пшеничне, олія пальмова, та олеїн пальмовий, сироп глюкозно-фруктозний, ароматизатор "паприка" (глюкозний сироп, спеції (порошок паприки 4%, суміш перців), сіль кухонна, підсилювач смаку та аромату (глутамат натрію), порошок цибулі, порошок часнику, гідролізований рослинний протеїн (з кукурудзи, екстракт дріжджів, екстракт розмарину, ароматизатор "коптильний"), солодовий екстракт, патока мальтозна, меланж яєчний, сіль кухонна (1,5 %), розпушувачі (бікарбонати натрію та монію), поліпшувач борошна (натрію метабусульфіт). Вміщує пшеницю, ГЛЮТЕН, ЯЙЦЕПРОДУКТИ, СУЛЬФІТИ. МОЖЕ ВМІЩУВАТИ В НЕЗНАЧНІЙ КІЛЬКОСТІ МОЛОЧНІ ПРОДУКТИ, СОЮ ТА КУНЖУТ.');
